    public final static int
           NUM_STATES        = 526,
           NT_OFFSET         = 124,
           LA_STATE_OFFSET   = 5668,
           MAX_LA            = 2147483647,
           NUM_RULES         = 525,
           NUM_NONTERMINALS  = 192,
           NUM_SYMBOLS       = 316,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 2226,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 121,
           EOLT_SYMBOL       = 121,
           ACCEPT_ACTION     = 4762,
           ERROR_ACTION      = 5143;

